import { useDispatch } from "react-redux";
import CardsContainers from "../components/Cardscontainer/CardsContainer";
import { useEffect } from "react";
import { getUsers } from "../redux/actions";

const Home = () => {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getUsers());
  }, [dispatch]);
  return (
    <>
      <h1>soy el Home</h1>
      <CardsContainers />
    </>
  );
};

export default Home;
